                [new Date("8-Sep"), 70.4],
                [new Date("8-Oct"), 80.4],
                [new Date("8-Nov"), 82.8],
                [new Date("8-Dec"), 74.7],
            ],
            "Unit3": [
                [new Date("8-Jan"), 65.4],
                [new Date("8-Feb"), 57.4],
                [new Date("8-Mar"), 69.3],
                [new Date("8-Apr"), 55.4],
                [new Date("8-May"), 76.9],
                [new Date("8-Jun"), 77.2],
